import React from 'react';
import Navbar from './Navbar';
import EventManagement from './admin/EventManagement';

const AdminDashboard = () => {
  return (
    <div className="min-h-screen bg-gray-100">
      <Navbar />
      <EventManagement />
    </div>
  );
};

export default AdminDashboard;
